import React from 'react'

class StretchToggle extends React.Component {
    render () {
        return <button onClick={this.props.switchStretchFeatures} className={this.props.selectedCategory? 'toggle on': 'toggle off'}>{this.props.selectedCategory? 'Stretch features enabled': 'Stretch features disabled'}</button>
    }
}

export default StretchToggle
